import "./App.css";
import { useState } from "react";
import Home from "./components/Home";
import Searhc from "./components/Search";

function App() {
  const [showSearchPage, setShowSearchpage] = useState(false);

  return <div className="app">{showSearchPage ? <Searhc /> : <Home />}</div>;
}

export default App;
